import React from 'react'
import './FaceRecognition.css'

window.process = {}
const FaceRecogniction = ({ imgUrl, box }) => {
    console.log(box)
    console.log(imgUrl)
    return (
      <figure className="center" style={{ display: 'inline-block', position: 'relative' }}>
        <img
          id="inputImage"
          src={imgUrl}
          alt=""
          style={{ height: "auto", maxWidth: '40rem' }}
        />
        <div className='bounding-box' style={{
          top: box.top,
          right: box.right,
          bottom: box.bottom,
          left: box.left,
        }} ></div>
      </figure>
    );
  };
   
  export default FaceRecogniction;
